// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import './App.css'; // Import your CSS file for transitions
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div className="App">
        <Route
          render={({ location }) => (
            <TransitionGroup>
              <CSSTransition
                key={location.key}
                timeout={300}
                classNames="fade"
                unmountOnExit
                appear
              >
                <Routes location={location}>
                  <Route path="/h" element={<Home />} />
                </Routes>
              </CSSTransition>
            </TransitionGroup>
          )}
        />
      </div>
    </Router>
  );
}

export default App;
